DROP TABLE IF EXISTS gdm_gis_staff CASCADE;

CREATE TABLE gdm_gis_staff (
    id character varying(50),
    man_title character varying(50) NOT NULL,
    man_type character varying(50) NOT NULL,
    man_name character varying(50) NOT NULL,
    org_id character varying(50) NOT NULL,
    phone_number character varying(50) NOT NULL,
    police_number character varying(50) NOT NULL,
    police_job character varying(500) NOT NULL,
    operator character varying(50) NOT NULL,
    valid numeric(1,0) DEFAULT 1,
    create_time bigint NOT NULL,
    update_time bigint NOT NULL,
    id_card character varying(50) NOT NULL,
    mark_type character varying(50) NOT NULL,
    duty_status character varying(50) NOT NULL,
    duty_status_time date NOT NULL,
    icon_file_path character varying(255) NOT NULL
);


CREATE UNIQUE INDEX ds_gis_staff_copy1_copy1_pkey ON gdm.gdm_gis_staff USING btree (id);

COMMENT ON COLUMN gdm_gis_staff.id IS 'id';
