COMMENT ON COLUMN gdm_gis_staff.org_id IS '所属机构id';
COMMENT ON COLUMN gdm_gis_staff.phone_number IS '电话';
COMMENT ON COLUMN gdm_gis_staff.police_number IS '警号';
COMMENT ON COLUMN gdm_gis_staff.police_job IS '职务';
COMMENT ON COLUMN gdm_gis_staff.operator IS '操作用户';
COMMENT ON COLUMN gdm_gis_staff.valid IS '有效性,0-无效,1-有效';
COMMENT ON COLUMN gdm_gis_staff.create_time IS '创建时间';
COMMENT ON COLUMN gdm_gis_staff.update_time IS '更新时间';
COMMENT ON COLUMN gdm_gis_staff.id_card IS '身份证号码';
COMMENT ON COLUMN gdm_gis_staff.mark_type IS '标签分类';
COMMENT ON COLUMN gdm_gis_staff.duty_status IS '勤务状态';
COMMENT ON COLUMN gdm_gis_staff.duty_status_time IS '勤务状态时间';
COMMENT ON COLUMN gdm_gis_staff.icon_file_path IS '头像路径';

